import { Component } from '@angular/core';


@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Frontend';


  constructor(
    private readService: EventsService
    ){}

    ngOnInit(): void{
      this.getevent();
    }

  getevent(){
    this.readService.getevent().subscribe({
      next:(res) => { 
          console.log(res)
      }, 
      error: (err) => {
        console.log(err)
      }

    })
  }

}
